    public final int getScopeUbound() { return SCOPE_UBOUND; }
    public final int getScopeSize() { return SCOPE_SIZE; }
    public final int getMaxNameLength() { return MAX_NAME_LENGTH; }

    public final static int
           NUM_STATES        = 527,
           NT_OFFSET         = 123,
           LA_STATE_OFFSET   = 5771,
           MAX_LA            = 2147483647,
           NUM_RULES         = 535,
           NUM_NONTERMINALS  = 197,
           NUM_SYMBOLS       = 320,
           SEGMENT_SIZE      = 8192,
           START_STATE       = 4103,
           IDENTIFIER_SYMBOL = 0,
           EOFT_SYMBOL       = 121,
           EOLT_SYMBOL       = 121,
           ACCEPT_ACTION     = 4827,
           ERROR_ACTION      = 5236;

